const int MOD = 1000000007;
const char nl = '\n';
const int MX = 100001; 

vector<vi> getOps(vi A) {
    int N = sz(A);
    vector<vi> bst(2);
    F0R(i, 2) {
        F0R(j, 2*N+10) {
            bst[i].pb(N);
        }
    }
    F0R(r, N+1) {
        /*if (r % 100 == 0) {
            dbg(r);
        }*/
        int pos[N+1];
        pos[N] = N;
        F0R(i, N) pos[A[i]] = i;
        // 0 goes to r
        vi cur;
        int lst = 0;
        while (true) {
            int needN = (pos[N] - r + (N+1)) % (N+1);
            if (needN == N) {
                FOR(i, lst, N+1) {
                    lst = i;
                    if (pos[i] != (r+i)%(N+1)) {
                        needN = i;
                        break;
                    }
                }
                if (needN == N) break;
            }
            cur.pb((pos[needN]-pos[N]+(N+1) * 2 - 1)%(N+1));
            swap(pos[needN], pos[N]);
        }
        F0R(i, N) {
            if (pos[i] != (r + i) % (N+1)) {
                goto bad;
            }
        }
        if (sz(cur) < sz(bst[sz(cur)%2])) {
            //dbg(A, r);
            bst[sz(cur)%2] = cur;
        }
        bad:
        ;
    }
    return bst;
}

void solve() {
    int N, M; cin >> N >> M;
    vi A(N), B(M);
    F0R(i, N) {
        cin >> A[i];
        A[i]--;
    }
    F0R(i, M) {
        cin >> B[i];
        B[i]--;
    }
    vector<vi> opsAs = getOps(A), opsBs = getOps(B);
    vi bstA, bstB;
    F0R(i, 2*N+10) bstA.pb(N);
    bool ok = false;
    F0R(a, 2) {
        F0R(b, 2) {
            vi opA= opsAs[a], opB = opsBs[b];
            if (sz(opA) == 2*N+10) continue;
            if (sz(opB) == 2*M+10) continue;
            if (sz(opA) % 2 != sz(opB) % 2) {
            if (N % 2 == 0 && M % 2 == 0) {
                continue;
            } else if (N % 2 == 0) {
                F0R(i, M) opB.pb(0);
            } else if (M % 2 == 0) {
                F0R(i, N) opA.pb(0);
            } else {
                    if (sz(opA) + N < sz(opB) + M) {
                        F0R(i, N) opA.pb(0);
                    } else F0R(i, M) opB.pb(0);
                }
            }
            assert(sz(opA) < 10000);
            assert(sz(opB) < 10000);
            while (sz(opA) < sz(opB)) {
                opA.pb(0); opA.pb(N-1);
            }
            while (sz(opB) < sz(opA)) {
                opB.pb(0); opB.pb(M-1);
            }
            if (sz(opA) < sz(bstA)) {
                bstA = opA;
                bstB = opB;
            }
            ok = true;
        }
    }
    if (!ok) {
        cout << -1 << nl; return;
    }
    cout << sz(bstA) << nl;
    F0R(i, sz(bstA)) {
        cout << bstA[i] + 1 << " " << bstB[i] + 1 << nl;
    }
}

int main() {
    ios_base::sync_with_stdio(0); cin.tie(0);

    int T = 1;
//    cin >> T;
    while(T--) {
        solve();
    }

	return 0;
}
